import * as React from 'react';
import {
  DataGrid,
  GridToolbarContainer,
  GridToolbarColumnsButton,
  GridToolbarFilterButton,
  GridToolbarExport,
  GridToolbarDensitySelector,
} from '@mui/x-data-grid';



const columns = [
    {
      field: 'ticker',
      headerName: 'TICKER',
      width: 150,
      editable: true,
    },
    {
        field: 'ceiling',
        headerName: 'CEILING',
        type: 'number',
        width: 110,
        editable: true,
      },
    {
      field: 'floor',
      headerName: 'FLOOR',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
      field: 'highest',
      headerName: 'HIGHEST',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
      field: 'lowest',
      headerName: 'LOWEST',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
      field: 'match',
      headerName: 'MATCH',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
      field: 'volume',
      headerName: 'VOLUME',
      type: 'number',
      width: 110,
      editable: true,
    },
  ];
  const rows = [
    {ticker: 'ACB', ceiling: 305, floor: 3.7, highest: 67, lowest: 4.3, match: 0.4, volume: 1000},
    {ticker: 'ACB', ceiling: 305, floor: 3.7, highest: 67, lowest: 4.3, match: 0.4, volume: 1000},
    {ticker: 'ACB', ceiling: 305, floor: 3.7, highest: 67, lowest: 4.3, atch: 0.4, volume: 1000},
    {ticker:'APH', ceiling: 452, floor: 25.0, highest: 51, lowest: 4.9, match: 42.2, volume: 1000},
    {ticker:'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000},
    {ticker:'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000},
    {ticker:'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000},
    {ticker:'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000},
    {ticker:'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000},
    {ticker:'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000},
    {ticker:'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000},
    {ticker:'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000},
    {ticker:'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 1000},

    
  ]; 
    

  export default function DataGridDemo() {
    return (
        <div style={{ height: 400, width: '100%', backgroundColor:'white' }}>
        <DataGrid
            rows={rows}
            columns={columns}
            pageSize={5}
            rowsPerPageOptions={[5]}
            checkboxSelection
            disableSelectionOnClick
           
        />
        </div>
    );
}
